var payROOT = "https://paystack.co/";
var payAPI = payROOT + "bosco/";
var Pwc =
	{
		key: null,

		setPublishableKey: function(key) {

		 	Pwc.key = key;
			//console.log(key);
        },

		createToken: function(paymentform, responseHandler) {

		 var cvc = 0;
		 var cardnumber = 0;
		 var expmonth = 0;
		 var expyear = 0;

		 var status ='error';
		var response = {error: {message: ""},token:"" };
		var  items = getAttributes('data-pwc', paymentform);
		//console.log(items);
			for (var i = 0, len = items.length; i < len; i++) {


			  if ((items[i].dataset.pwc) == 'number')
			  {
				  cardnumber = items[i].value;
				 cardnumber = cardnumber.replace(/\s+/g, '');

			  }
			  if ((items[i].dataset.pwc) == 'cvc')
			  {
				  cvc = items[i].value;
			  }
			  if ((items[i].dataset.pwc) == 'exp')
			  {
				  expiry = items[i].value;
				  expiry = jQuery.payment.cardExpiryVal(expiry);
				  expmonth = expiry.month;
				  expyear = expiry.year;

			  }

			}

			var exitloop = 0;

			console.log(expyear);
			cardval = (jQuery.payment.validateCardNumber(cardnumber));
			cardtype = jQuery.payment.cardType(cardnumber);

			expiryval = (jQuery.payment.validateCardExpiry(expmonth, expyear));

			if (cardval == false )
			{
				response.error.message = 'Invalid Card Number';
				exitloop =  1;

			}


			else if (cvc == 0)
			{
				response.error.message = 'Invalid CVV';
				console.log (cvc);
				if (cvc.length != 3)
				{
					response.error.message = 'CVV must be 3 digits';
				}

				exitloop = 1;
			}




			else if (expiryval == false)
			{
				response.error.message = 'Invalid Expiry Date';
				exitloop = 1;
			}





			if (exitloop == 1)
			{

				responseHandler(status, response);
			}
			else
			{


				var card =  new Array(4);
				card[0] = cardnumber;
				card[1] = cvc;
				card[2] = expmonth;
				card[3] = expyear;

				var cardstring = card.join("*")
				var enc =  cryptico.encrypt(cardstring, Pwc.key);
				var tosend = (enc.cipher);

				jQuery.ajax({
            type: 'POST',
            url: payAPI + 'createtoken/',
            data: {
                clientdata: tosend,
				cardtype: cardtype

            },

            dataType: 'json',
            timeout: 20000,
            success: function(r) {


                if (r.status == 1) {

						response.error = false;
						response.token = r.token;
						response.last4 = r.last4;

                }
                else
                {
                    response.error.message = r.message;

                }

				responseHandler(status, response);
            },
            error: function(r) {

				//alert('err');
            	 response.error.message = 'Error!! Please check your network connection';
				 responseHandler(status, response);
            }
        });

			}




        }
	};


	var getAttributes = function(attribute, paymentform) {


    var allElements = document.getElementsByTagName('*'),
        allElementsLen = allElements.length,
        curElement,
        i,
        results = [];

    for(i = 0; i < allElementsLen; i += 1) {
        curElement = allElements[i];

        if(curElement.getAttribute(attribute)) {
            results.push(curElement);
        }
    }

    return results;
};
